      'top': 'topCharacters',
      'male': 'maleCharacters',
      'female': 'femaleCharacters',
      'wrong-gender': 'wrongGender',
      'hall-of-shame': 'hallOfShame',
      'top/:race': 'topRace',
      'male/:race': 'maleRace',
      'female/:race': 'femaleRace',
      'characters/:id': 'characterDetails',
